import React from 'react';
import * as S from './ComponentStyled';

export default function ManualControl() {
  return (
    <div>
      <S.Title>Manual Control</S.Title>
      <S.GeneralText style={{ fontWeight: 'bold', fontSize: '20px ', marginTop: '10px' }}>
        Input Coordinate
      </S.GeneralText>

      <div style={{ display: 'flex', marginTop: '5px', marginBottom: '10px' }}>
        <S.GeneralText>Latitude:</S.GeneralText>
        <div style={{ border: '1px solid white', width: '10vh' }}></div>
      </div>
    </div>
  );
}
